// Labels voor de knop
var buttonLabelOn = "AAN Zetten";
var buttonLabelOff = "UIT Zetten";

// Haal het datatype op
var type = getDataPointType(point.id);

// AANGEPAST: Nu ook checken op "BINARY" zodat je coils kunt schakelen
if (type != "MULTISTATE" && type != "NUMERIC" && type != "BINARY") {
    return "Ongeldig datatype (" + type + "). Selecteer Binary, Numeric of Multistate.";
}

// Bepaal de huidige status
// Binary punten zijn true/false, Numeric zijn 1/0. We vangen beide mogelijkheden af.
var isOn = (value === 1 || value === true || value == "true");

// Command string voor Scada-LTS update
var command = "mango.view.setPoint(" + point.id + ", " + pointComponent.id + ", newValue);";

// Bepaal de waarde die we moeten sturen als er geklikt wordt
// Bij BINARY sturen we "true" of "false". Bij andere types 1 of 0.
var valOn = (type == "BINARY") ? "true" : "1";
var valOff = (type == "BINARY") ? "false" : "0";
var newValueToSend = isOn ? valOff : valOn;

// HTML Opbouw
var s = "";
s += "<div style='position: relative;'>";

s += "<button ";
s +=    "style='padding: 5px 10px; font-size: 14px; cursor: pointer; background-color: " + (isOn ? "#d9534f" : "#5cb85c") + "; color: white; border: none; border-radius: 5px;' ";
s +=    "onclick='var newValue = " + newValueToSend + "; " + command + "'>";
s +=    (isOn ? buttonLabelOff : buttonLabelOn);
s += "</button>";

s += "</div>";

return s;

// Helper functie om type op te halen
function getDataPointType(identifier) {
    var types = {
        0: "UNKNOWN",
        1: "BINARY",
        2: "MULTISTATE",
        3: "NUMERIC",
        4: "ALPHANUMERIC",
        5: "IMAGE"
    };

    var dpDAO = new com.serotonin.mango.db.dao.DataPointDao();
    var dp = dpDAO.getDataPoint(identifier);
    var locator = dp.getPointLocator();
    return types[locator.getDataTypeId()];
}

